// Let us find the houses in Cambria which have four bedrooms.
function housesInCamriaFilter(array) {
    var passed = [];
    for(var i=0; i < array.length; i++){
        var house = array[i];
        if (house.location === "Cambria" && house.bedrooms == 4) passed.push(house);
    }
    return passed;
}
console.log(housesInCamriaFilter(REALESTATE_DATA));


// Let us find out the houses where the price per square foot is less than 20.
function lowPricePerSquareFoot(array) {
    var passed = [];
    for(var i=0; i < array.length; i++){
        var house = array[i];
        if (house['price-sq-ft'] < 20) passed.push(house);
    }
    return passed;
}
console.log(lowPricePerSquareFoot(REALESTATE_DATA));


// Using higher order functions we can seperate out the filter from the control flow as follows
function filter(array, test){
    var passed = [];
    for(var i = 0; i < array.length; i++){
        if (test(array[i])){
            passed.push(array[i]);
        }
    }
    return passed;
}
console.log(filter(REALESTATE_DATA, function(house){
    return house.location === "Cambria" && house.bedrooms == 4;
}));

console.log(filter(REALESTATE_DATA, function(house){
    return house['price-sq-ft'] < 20;
}));


